import { BrowserRouter, Routes, Route } from "react-router-dom";
import Art from "./Art";


export default function App() {
  return (
    <BrowserRouter>
      <Routes>

          <Route index element={<Art />} />
          <Route path="blogs" element={<Art />} />
          <Route path="contact" element={<Art />} />
          <Route path="*" element={<Art />} />

      </Routes>
    </BrowserRouter>
  );
}
